import React from 'react';
import pc from './MyPosts.module.css'
const MyPosts = () => {
    return (

        <div>
            My posts
            <div>
                New post
            </div>
            <div>
                <div className={pc.item}>
                    post1
                </div>
                <div className={pc.item}>
                    post2
                </div>
            </div>
        </div>
);
}
export default MyPosts;
